import React from 'react'
import experience from './data/dataExperience'

function Experience() {
  return (
    <>
    <section id='experience' className='container experience-section'>
      <div className='exp-title'>
      <h1>Experience</h1>
      </div>
      <div className='exp-card-group'>
        {experience.map((curElem)=>{
          const{id,position,company,timePeriod,location,skill}=curElem;
          return(
            <div className='row exp-card' key={id}>
              <div className='col-sm-'>{position}
              <br /><span className='exp-company'>{company}</span>
              <span className='exp-last'>{timePeriod}</span>
              <br />
              {location}
              <span className='exp-last'>{skill}</span></div>
            </div>
          )
        })}
      </div>
      
      
      
    </section>
    </>
  )
}

export default Experience
